import React, { useState } from 'react';

const Feedback = () => {
  const [form, setForm] = useState({ name: '', message: '' });
  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setSubmitted(true);
  };

  if (submitted) {
    return (
      <div className="p-4 bg-white rounded shadow max-w-2xl mx-auto text-center">
        <h2 className="text-2xl font-bold mb-4">Thank you for your feedback!</h2>
        <p>We appreciate your input.</p>
      </div>
    );
  }

  return (
    <div className="p-4 bg-white rounded shadow max-w-2xl mx-auto">
      <h2 className="text-2xl font-bold mb-4">ðŸ’¬ Feedback</h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label className="block mb-1 font-semibold" htmlFor="name">Name</label>
          <input
            id="name"
            name="name"
            type="text"
            required
            value={form.name}
            onChange={handleChange}
            className="w-full border border-gray-300 rounded p-2"
          />
        </div>
        <div>
          <label className="block mb-1 font-semibold" htmlFor="message">Message</label>
          <textarea
            id="message"
            name="message"
            required
            value={form.message}
            onChange={handleChange}
            className="w-full border border-gray-300 rounded p-2"
            rows={4}
          />
        </div>
        <button
          type="submit"
          className="bg-primary hover:bg-blue-700 text-white font-semibold py-2 px-6 rounded shadow transition duration-300"
        >
          Submit
        </button>
      </form>
    </div>
  );
};

export default Feedback;
